import './App.css';
import Box from '@mui/material/Box';
import Header from "./components/Header"
function App() {
  return (
    <Box className="App">
      <Header />
      <img width="400px" src={require("./images/Willis_Deluxe_Detail_Logo.svg")} />
    </Box>
  );
}

export default App;
